document.addEventListener("DOMContentLoaded", function (event) {
  collapse();

  window.addEventListener(
    "resize",
    function (event) {
      collapse();
    },
    true
  );

  function collapse() {
    var x = window.matchMedia("(max-width: 980px)");
    if (x.matches) {
      document.getElementById("side-menu").classList.remove("w-25");
      } else {
        document.getElementById("side-menu").classList.add("w-25");

    }
  }
});
